import { Component, EventEmitter, Output } from '@angular/core';
import { Order } from 'src/app/models/order';

@Component({
  selector: 'app-add-order-form',
  templateUrl: './add-order-form.component.html',
  styleUrls: ['./add-order-form.component.css']
})
export class AddOrderFormComponent {

  o:Order = {} as Order;
  @Output() OrderCreated = new EventEmitter<Order>();

  constructor() { }

  ngOnInit(): void{

  }

  CreateOrder(){
    this.OrderCreated.emit(this.o);
  }

}
<h2>Add an order</h2>
<p>Description:</p>
<input type="text" [(ngModel)] = "o.description" />
<p>Restaurant:</p>
<input type="text" [(ngModel)] = "o.restaurant" />
<p>Rating (1-5):</p>
<p>Description:</p>
<input type="number" [(ngModel)] = "o.rating" />
<p>Order again?</p>
<input type="checkbox" [(ngModel)] = "o.orderAgain" />
